ICAgICAgIGC9IZDRgICAgICAgICA9YZARgMCAgICAgICAtYbAhkNCAgICAgICAhYbwhkNCAgICAgICAgYL0hkNGAgICAgICAgID1hkBGAwICAgICAgIC1hsCGQ0ICAgICAgICFhvCGQ0ICAgICAgICBgvSGQ0YCAgICAgICAgPWGQEYDAgICAgICAgLWE9Lp/wMbo1GZVDc1MAAAAABJRU5ErkJggg==\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":900,\"height\":301},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"39c3a774-36ae-4055-b120-63b1e854e5b1\"},{\"params\":{\"text\":\"<p>In order to determine the force constant (stiffness) K1 of an elastic spring (R1), of free length \\\\(l1\\\\) = 20 cm, we consider the system of the adjacent figure.</p>\\n\\n<p>In this system, the extremity A of (R1) is connected to a fixed support. The other extrimity is connected at O to another spring (R2), of stiffness K2 = 100 N/m and a free length \\\\(l2\\\\) = 30 cm.</p>\\n\\n<p>The other extremity B of (R2) is connected to another fixed support. The system formed of (R1) and (R2) is at rest.</p>\\n\\n<p><strong>1)</strong> Reffering to the figure, calculate the length \\\\(l1'\\\\) of (R1).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"45408cfe-9b45-4009-934f-7f3feb1cbf78\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"61237876-0292-4e21-9a2f-cd72f0f01436\"},{\"params\":{\"text\":\"<p><strong>2) a)</strong> Show that the two springs are elongated.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"fda5c7a0-5a57-4912-939c-e64c6a775202\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"a662ca59-7100-4a13-a3ab-3826f69b6a98\"},{\"params\":{\"text\":\"<p><strong>2) b)</strong> Calculate the elongations ΔL1 of (R1) and ΔL2 of (R2).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"63ebae8f-7983-4fdc-83b5-6e949635e17d\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"d550e9bf-d4a6-4415-b4a6-aa3eb1000080\"},{\"params\":{\"text\":\"<p><strong>2) c)</strong> (R1) and (R2) are in interaction. Why?</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9171e7aa-4f6b-4fbc-b48d-2c600bceed98\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"2ae5b4ee-ca25-481a-92c5-f5a625a766f7\"},{\"params\":{\"text\":\"<p><strong>3)</strong> Write down the vector relation between the two forces \\\\(\\\\vec{T1}\\\\), exerted by (R1) on (R2), and \\\\(\\\\vec{T2}\\\\), exerted by (R2) on (R1).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f7c734b2-cd63-4894-9589-3847164062d9\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"9f3a5b9b-4944-484b-b1db-5e44f2835e9f\"},{\"params\":{\"text\":\"<p><strong>4)</strong> Calculate the magnitude T2 of the force \\\\(\\\\vec{T2}\\\\) and deduce the magnitude T1 of \\\\(\\\\vec{T1}\\\\).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e6f70eb6-50d2-4803-a08b-833f554685df\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"22de62d5-5302-42f4-9246-cdc96ddc5d7e\"},{\"params\":{\"text\":\"<p><strong>5)</strong> Find the value of K1.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"439413e1-9e4c-4e47-b5da-a4256b075be2\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"0fc68013-c07a-4eb3-a233-4f9c85b709be\"}]},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Mechanical interaction\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Mechanical interaction\"},\"subContentId\":\"9adf952e-e8b3-4194-8e4d-41947295dc90\"}, h8/rrr7/44ovxCgcHBwcHB4d/BZ/v/zJ5U70p2nHfAAAAAElFTkSuQmCC\",\"mime\":\"image/png\",\"copyright\":{\"license\":\"U\"},\"width\":623,\"height\":209},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c052c2b8-62e1-4cb5-a42d-47422babd36c\"},{\"params\":{\"text\":\"<p><strong>4)</strong> In order to calculate the force of tension applied by spring R2 which is \\\\(\\\\vec{T2}\\\\) we should use the rule we know that allows us to calculate it. This rule is Hooke's law:</p>\\n\\n<p>The magnitude of \\\\(\\\\vec{T2}\\\\) is:</p>\\n\\n<p>T2 = K2 x ΔL2</p>\\n\\n<p>Where K2 is the stiffness of the spring R2 which we have as a given. K2 = 100 N/m.</p>\\n\\n<p>And ΔL2 is the elongation of spring R2, which we already calculated in part (2,b). ΔL2 = 5 cm = 0.05 m.</p>\\n\\n<p>So, T2 = 100 N/m x 0.05 m = 5 N.</p>\\n\\n<p>We are asked also to deduce the magnitude T1 of force \\\\(\\\\vec{T1}\\\\) applied by spring R1.</p>\\n\\n<p>Given that the system formed of (R1) and (R2) is at rest. So the system is at equilibrium.</p>\\n\\n<p>Which means that the two forces \\\\(\\\\vec{T1}\\\\) and \\\\(\\\\vec{T2}\\\\) are at equilibrium. So they have same line of action, opposite directions and same magnitude.</p>\\n\\n<p>We conclude that T1 = T2 = 5 N.</p>\\n\\n<p><strong>5) </strong>We know now that T1 = 5 N, we also calculated previously ΔL1 = 10 cm = 0.1 m.</p>\\n\\n<p>Then, using Hooke's law we are able to find the stiffness K1 of the spring R1.</p>\\n\\n<p>Hooke's law: T1 = K1 x ΔL1</p>\\n\\n<p>5 N = K1 x 0.1 m</p>\\n\\n<p>K1 = \\\\(\\\\frac{5 N}{0.1 m}\\\\)</p>\\n\\n<p>So, K1 = 50 N/m.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f777ca41-ed59-4501-a063-03a74932b275\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"3cef5b5b-e7b4-4b56-94ba-a266ddc1be92\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"c18c2591-5053-4fa1-83d3-7bf565f0909a\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.13","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"2012 - Session 2 - Question III","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2/xapi-generator.js?version=1.2.13","/h5p/libraries/H5P.StandardPage-1.5/standard-page.js?version=1.5.15","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?
